THE NIGHT WATCH 2023 

This was super fun to do. A collector asked me to draw her children’s favorite toys. I went and met the toys in person last Christmas and they kindly sat for me. It was lovely to observe and depict the love and battering 😂 these toys have taken over the years - a story about childhood and the passing of time. 🦊 🧸 🐕 ❤️ 
